   def test_log10_float_rank0(self):
      arg=52.2519689858
      res=log10(arg)
      ref=1.7181026604
      self.assertTrue(isinstance(res,float),"wrong type of result.")
      self.assertTrue(Lsup(res-ref)<=self.RES_TOL*Lsup(ref),"wrong result")
